function addConnection(stateA, stateB){
    for (let contintent in Contintents) {
        Contintents[contintent].states.forEach((state) => {
            if (state.country === stateA) {
                let connections = "connections"
                if (!(connections in state)){
                    state[connections] = new Set();
                }
                state[connections].add(stateB)
            }
        })
    }
}
Connection.forEach((con)=>{
    addConnection (con.A, con.B);
    addConnection (con.B, con.A);
})


